import { Fragment } from "react";

import classes from "./Header.module.css";

const Header = (props) => {
  return (
    <nav className={classes.header}>
      <div className={classes.header - item}>
        <div>Name</div>
        <div>
          <span>item1</span>
          <span>item2</span>
          <span>item3</span>
          <span>item4</span>
        </div>
      </div>
    </nav>
  );
};

export default Header;
